webpackJsonp([0x68c94cc09cac],{277:function(e,t){e.exports={data:{markdownRemark:{html:"<p>My initial idea from the course's first class seemed promising, but I don't think I will pursue it all the way.\nAlthough Elon Musk is somewhat of a polarizing figure and he has been on the collective consciousness lately, I\ndon't think he's polarizing <em>enough</em> such that I can convince lots of people to either vehemently defend or\ndisparage him (or his \"horcruxes\") in the real world.</p>\n<p>The direction I'd like to take my class project involves <em>astrology</em>, a topic which has seen a resurgence in popularity\nthis year, especially amongst millenials and on social media. Astrologers already peddle in something that looks and feels\na bit like fake news; horoscopes provide generic insights which seem to be subjectively true to the believer, but have\nno real basis in scientific fact.</p>",frontmatter:{date:"13 September, 2018",title:"Week 1 project brainstorm"},fields:{slug:"/blog/itp/faking-the-news/project-brainstorm/"}}},pathContext:{slug:"/blog/itp/faking-the-news/project-brainstorm/"}}}});
